import Card from "./Card";
import Card2 from "./Card2";

export default class Gallery extends Component {
  render() {
    return (
      <div className="gallery">
        <div className="container">
          {items.map((e) => (
            <Card2
              title={e.title}
              imageUrl={e.imageUrl}
              isHovered={e.isHovered}
            />
          ))}
        </div>
      </div>
    );
  }
}
